import React from 'react';
import { Link } from 'react-router-dom';

function Navigation({ coins }) {
  return (
    <nav style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
      <ul style={{ display: 'flex', listStyle: 'none' }}>
        <li style={{ marginRight: '1rem' }}><Link to="/entries">All Entries</Link></li>
        <li style={{ marginRight: '1rem' }}><Link to="/create">Create New Entry</Link></li>
        <li style={{ marginRight: '1rem' }}><Link to="/plot">Statistics</Link></li>
        <li style={{ marginRight: '1rem' }}><Link to="/coins">Coins</Link></li>
      </ul>
      <div>
        <p style={{ marginRight: '1rem' }}>Total Coins: {coins}</p> {/* Displaying total coins */}
      </div>
    </nav>
  );
}

export default Navigation;
